import React from "react";
import Sidebar from "../components/Sidebar";
import Topbar from "../components/Topbar";
import StatCard from "../components/StatCard";
import ActionCard from "../components/ActionCard";
import { Box, Grid, Typography, Paper } from "@mui/material";
import { Link as RouterLink } from "react-router-dom";

export default function Dashboard({ mode, setMode, lang, setLang, t, onLogout }) {
  // Brand palette
  const PRIMARY = "#30D5C8";
  const BORDERS_TEXT = "#607D8B";
  const HEADINGS = "#37474F";
  const HIGHLIGHT = "#BCE34A";

  return (
    <Box sx={{ display: "flex" }}>
      <Sidebar t={t} />
      <Box sx={{ flex: 1 }}>
        <Topbar
          mode={mode}
          setMode={setMode}
          lang={lang}
          setLang={setLang}
          t={t}
          onLogout={onLogout}
        />
        <Box
          sx={{
            p: { xs: 2, md: 4 },
            minHeight: "100vh",
            // Soft brand background
            background: `linear-gradient(180deg, ${PRIMARY}11 0%, #ffffff 35%)`
          }}
        >
          {/* MAIN HEADINGS */}
          <Typography variant="h4" fontWeight={800} sx={{ mb: 0.5, color: HEADINGS }}>
            {t.dashboardOverview}
          </Typography>
          <Typography variant="body1" mb={3} sx={{ color: BORDERS_TEXT }}>
            {t.dashboardOverviewSubtitle}
          </Typography>
          {/* STATS GRID */}
          <Grid container spacing={3} sx={{ mb: 3 }}>
            <Grid item xs={12} sm={6} md={3}>
              <StatCard label={t.trainsReady} value="147" sublabel="180" icon="train" />
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <StatCard label={t.maintenanceAlerts} value="8" sublabel={t.active} icon="build" />
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <StatCard label={t.adDeadlines} value="3" sublabel={t.thisWeek} icon="timer" />
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <StatCard label={t.systemHealth} value="98.2%" sublabel={t.uptime} icon="check_circle" />
            </Grid>
          </Grid>
          {/* QUICK ACTIONS */}
          <Box sx={{ height: 6, borderRadius: 2, background: `linear-gradient(90deg, ${PRIMARY}, ${HIGHLIGHT})`, mb: 2 }} />
          <Typography variant="h6" fontWeight={800} mt={1} mb={0.5} sx={{ color: HEADINGS }}>
            {t.quickActions}
          </Typography>
          <Typography mb={2} variant="body2" sx={{ color: BORDERS_TEXT }}>
            {t.quickActionsSubtitle}
          </Typography>
          <Grid container spacing={3} mb={5}>
            <Grid item xs={12} sm={6} md={3}>
              <ActionCard
                label={t.dataPrediction}
                description={t.dataPredictionDesc}
                icon="chart"
                component={RouterLink}
                to="/data-prediction"
              />
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <ActionCard
                label={t.maintenanceHub}
                description={t.maintenanceHubDesc}
                icon="build"
              />
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <ActionCard
                label={t.trainAudit}
                description={t.trainAuditDesc}
                icon="audit"
              />
            </Grid>
            <Grid item xs={12} sm={6} md={3}>
              <ActionCard
                label={t.stablingStatus}
                description={t.stablingStatusDesc}
                icon="stabling"
              />
            </Grid>
          </Grid>
          {/* STATUS / PRIORITIES PANELS */}
          <Grid container spacing={3}>
            <Grid item xs={12} md={4}>
              <Paper sx={{
                bgcolor: '#ffffff',
                p: 2,
                borderRadius: 2,
                boxShadow: `0 8px 24px ${PRIMARY}1a`,
                border: `1px solid ${BORDERS_TEXT}33`,
                position: 'relative',
                height: '100%'
              }}>
                <Box sx={{ position: 'absolute', top: 0, left: 0, right: 0, height: 4, bgcolor: PRIMARY, borderTopLeftRadius: 8, borderTopRightRadius: 8 }} />
                <Typography variant="subtitle1" fontWeight={600}>
                  {t.todaysPriorities}
                </Typography>
                <Typography variant="body2" sx={{ color: BORDERS_TEXT }}>
                  {t.samplePriority1}<br />{t.samplePriority2}
                </Typography>
              </Paper>
            </Grid>
            <Grid item xs={12} md={4}>
              <Paper sx={{
                bgcolor: '#ffffff',
                p: 2,
                borderRadius: 2,
                boxShadow: `0 8px 24px ${PRIMARY}1a`,
                border: `1px solid ${BORDERS_TEXT}33`,
                position: 'relative',
                height: '100%'
              }}>
                <Box sx={{ position: 'absolute', top: 0, left: 0, right: 0, height: 4, bgcolor: HIGHLIGHT, borderTopLeftRadius: 8, borderTopRightRadius: 8 }} />
                <Typography variant="subtitle1" fontWeight={600}>
                  {t.systemStatus}
                </Typography>
                <Typography variant="body2" sx={{ color: BORDERS_TEXT }}>
                  {t.operational} / {t.secure}
                </Typography>
              </Paper>
            </Grid>
            <Grid item xs={12} md={4}>
              <Paper sx={{
                bgcolor: '#ffffff',
                p: 2,
                borderRadius: 2,
                boxShadow: `0 8px 24px ${PRIMARY}1a`,
                border: `1px solid ${BORDERS_TEXT}33`,
                position: 'relative',
                height: '100%'
              }}>
                <Box sx={{ position: 'absolute', top: 0, left: 0, right: 0, height: 4, bgcolor: HEADINGS, borderTopLeftRadius: 8, borderTopRightRadius: 8 }} />
                <Typography variant="subtitle1" fontWeight={600}>
                  {t.loginSuccessful}
                </Typography>
                <Typography variant="body2" sx={{ color: BORDERS_TEXT }}>
                  {t.welcomeMessage}
                </Typography>
              </Paper>
            </Grid>
          </Grid>
        </Box>
      </Box>
    </Box>
  );
}
